CREATE TABLE IF NOT EXISTS `s_users` (
  `RowID` int(11) NOT NULL AUTO_INCREMENT,
  `national_id` varchar(10) NOT NULL DEFAULT '0',
  `fullname` varchar(200) NOT NULL,
  `firstname` varchar(50) NOT NULL,
  `middlename` varchar(50) DEFAULT NULL,
  `lastname` varchar(50) NOT NULL,
  `dob` date DEFAULT NULL,
  `placeofbirth` varchar(150) NOT NULL,
  `gender` varchar(50) NOT NULL,
  `uname` varchar(200) NOT NULL,
  `pword` varchar(200) DEFAULT NULL,
  `requestedpwd` varchar(200) DEFAULT 'uCg1RTij',
  `email` varchar(200) NOT NULL,
  `cellphone` varchar(20) NOT NULL,
  `activationcode` int(6) unsigned zerofill NOT NULL,
  `roleid` int(6) unsigned NOT NULL DEFAULT 5,
  `mda` int(3) NOT NULL DEFAULT 51,
  `station` int(4) NOT NULL DEFAULT 53,
  `dateset` datetime DEFAULT NULL,
  `customertype` varchar(50) NOT NULL DEFAULT 'NATIONAL_ID_HOLDER',
  `country` varchar(100) NOT NULL DEFAULT 'KENYA',
  `locked` int(11) NOT NULL DEFAULT 0,
  `blacklist` int(11) NOT NULL DEFAULT 0,
  `lastchanged` datetime DEFAULT NULL,
  `createdby` int(11) NOT NULL DEFAULT 0,
  `changedby` int(11) NOT NULL DEFAULT 0,
  PRIMARY KEY (`RowID`)
)

